INSERT INTO `fa_validation_rules` (`id`, `rule_id`, `rule_name`, `rule_type`, `source_table`, `source_field`, `target_table`, `target_field`, `validation_expression`, `expected_value`, `error_message`, `priority`, `is_active`, `created_time`, `updated_time`) VALUES
(1, 'RULE_001', '店铺名称校验', 'FIXED_VALUE', 'main_data', 'store_name', NULL, NULL, 'store_name IN (\"泉州优品家享家居有限公司\", \"泉州小米景明科技有限公司\")', '泉州优品家享家居有限公司,泉州小米景明科技有限公司', '店铺名称必须为：泉州优品家享家居有限公司 或 泉州小米景明科技有限公司', 1, 'Enable', '2025-09-25 09:38:32', '2025-09-25 10:07:06'),
(2, 'RULE_002', '品类校验', 'FIXED_VALUE', 'main_data', 'category', NULL, NULL, 'category IN (\"手机\", \"平板\", \"智能手表\", \"手环\")', '手机,平板,智能手表,手环', '品类必须为：手机、平板、智能手表或手环', 1, 'Enable', '2025-09-25 09:38:32', '2025-09-25 10:07:07'),
(3, 'RULE_003', '订单金额上限校验', 'RANGE', 'main_data', 'order_amount', NULL, NULL, 'order_amount > 0 AND order_amount <= 6000', '0-6000', '订单金额必须在0-6000元之间', 2, 'Enable', '2025-09-25 09:38:32', '2025-09-25 10:07:08'),
(4, 'RULE_004', '政府补贴金额计算校验', 'CALCULATION', 'main_data', 'subsidy_amount', NULL, NULL, 'subsidy_amount = LEAST(order_amount * 0.15, 500)', NULL, '政府补贴金额计算错误：应为订单金额*15%，最高500元', 2, 'Enable', '2025-09-25 09:38:32', '2025-09-25 10:07:08'),
(5, 'RULE_005', '实付金额计算校验', 'CALCULATION', 'main_data', 'actual_amount', NULL, NULL, 'actual_amount = order_amount - subsidy_amount', NULL, '实付金额计算错误：应为订单金额-政府补贴金额', 2, 'Enable', '2025-09-25 09:38:32', '2025-09-25 10:07:09'),
(6, 'RULE_006', '交易时间区间校验', 'RANGE', 'main_data', 'transaction_time', NULL, NULL, 'transaction_time >= \"2025-01-01\" AND transaction_time <= \"2025-12-31\"', '2025-01-01,2025-12-31', '交易时间必须在2025年1月1日至2025年12月31日之间', 1, 'Enable', '2025-09-25 09:38:32', '2025-09-25 10:07:10'),
(7, 'RULE_007', 'SN码一致性校验', 'CROSS_TABLE', 'main_data', 'sn_code', 'ocr_results', 'extracted_sn', 'main_data.sn_code = ocr_results.extracted_sn', NULL, 'SN码与OCR识别结果不一致', 3, 'Enable', '2025-09-25 09:38:32', '2025-09-25 10:07:11');
